import './GlobalNav.css';
import menu from './Menu';
import Dropdownmenu from "./dropdownmenu";
import Dropdowncheckbox from "./Dropdowncheckbox";


function GlobalNav({className, onNav}) {
    debugger
    const list = menu.map(item => {
        return (<li className="menu__item" key={item.name}>
                <a onClick={onNav} href="{item.path}" data-target={item.name}>{item.name} </a>
            </li>

        );
    });

    return (
        <div>
            <Dropdowncheckbox/>
            <nav className={'topnav  ${className}'}>
                <ul className="menu">
                    {list}
                    <Dropdownmenu onNav={onNav}/>
                </ul>
            </nav>
            <label className="menu-icon add" htmlFor="checkbox"><span className="navicon"></span>
                <i className="gg-play-list-add" id="add"></i><span className="menu__text">Menu</span>
            </label>
            <label className="menu-icon remove" htmlFor="checkbox"><span className="navicon"></span>
                <i className="gg-play-list-remove" id="remove"></i>
            </label>
        </div>

    );
}

export default GlobalNav;
